Ambush at Cimarron Pass  aka  L'urlo di guerra degli apaches  (Western 1958)  Scott Brady, Margia Dean &amp; Clint Eastwood


The quality of this film is only fair folks.  Sorry!


Language............: English
Subtitles...........: N/A
Duration............: 73 min.
Resolution..........: 1280 x 640
Sample..............: Included in folder.


Storyline:

  The survivors of an Army patrol ambushed by Indians hook up with a group of cowboys who have also been attacked, and together they try to get to safety at the fort. Unfortunately for them, they're carrying a shipment of several dozen rifles that the Indians want, and are determined to get.

Review:    Eastwood appears as a Southern cowboy Keith Williams who is upset over having to join up with a group of Yankees who have been attacked by the same group of Indians. Most film guides include in their entry for this film a quote attributed to Eastwood, &quot;probably the lousiest Western ever made.&quot; This film is also notable for a scene in which Brady beats Eastwood in a fistfight, possibly the only screen-fight that Eastwood ever lost.


